    fetch(`https://api-idap.infinite-uptime.com/api/3.0/idap-api/login?username=${username}&password=${password}`, {
      method: 'POST',
      headers: {
        'Accept': 'application/json',
      },
    })
      .then(response => response.json())
      .then(data => {
        
        console.log(data);
      })
      .catch(error => {
        
        console.error(error);
      });
    
    
    return await response.json;
}
